import React from "react";
import "../../App.css";
import Cards from "../Assets/Cards";
import HeroSection from "../Assets/HeroSection";
import Footer from "../Assets/Footer";

function Home() {
  return (
    <>
      <HeroSection
        authenticated={this.state.authenticated}
        onLogout={this.handleLogout}
      />
      <Cards />
      <Footer />
    </>
  );
}

export default Home;
